        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "برلين (ألمانية: Berlin) هي عاصمة جمهورية ألمانيا الاتحادية، وإحدى ولايات ألمانيا الست عشرة، كما أنها أكبر مدن ألمانيا من حيث عدد السكان. وتعتبر برلين إحدى \"الولايات المدن\" الثلاث بجمهورية ألمانيا الاتحادية (إلى جانب بريمن وهامبورغ)، وتأتي هذه التسمية من كون حدود المدينة هي نفسها حدود الولاية. وبرلين هي أيضاً ثاني أكبر مدن الاتحاد الأوروبي بعد العاصمة البريطانية لندن.وخلال فترةالحرب الباردة وتحديداً في عام 1961، قامت حكومة ألمانيا الشرقية بتشييد ما كان يعرف بـجدار برلين. هكذا أصبحت برلين مدينة مُقسمة إلى جزئين: جزء غربي يتبع ألمانيا الغربية والآخر شرقي يتبع ألمانيا الشرقية. وبقي الحال في برلين على هذا النحو إلى حين سقوط الجدار في عام 1989 وتوحيد الألمانيتين في عام 1990، واختيرت برلين بعدها عاصمة جمهورية ألمانيا الاتحادية ومركز حكومتها والبرلمان، وإحدى أهم المدن الأوروبية."@ar .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlin (prononcé [bɛʁ.lɛ̃] ; en allemand Berlin [bɛɐ̯.ˈliːn] ) est la capitale et la plus grande ville d'Allemagne. Située dans le nord-est du pays, elle forme un land (État fédéré) à part entière et compte environ 3,5 millions d'habitants. Ses habitants s'appellent les Berlinois. Berlin est la deuxième ville et la septième agglomération la plus peuplée de l'Union européenne. L'agglomération de Berlin s'étend sur 3 734 km2 et compte 4,4 millions d'habitants, et la région métropolitaine de Berlin-Brandebourg qui cumule les Länder de Berlin et de Brandebourg regroupe au total près de 6 millions d'habitants. Fondée au XIIIe siècle, Berlin a été successivement capitale du royaume de Prusse (1701-1871), de l'Empire allemand (1871-1918), de la République de Weimar (1919-1933) et du Troisième Reich (1933-1945). Après 1945 et jusqu'à la chute du Mur de Berlin en 1989, la ville est partagée en quatre secteurs d'occupation. Pendant la Guerre froide, le secteur soviétique de la ville, nommé Berlin-Est, est devenu la capitale de la République démocratique allemande, tandis que Berlin-Ouest était politiquement rattachée à la République fédérale d'Allemagne, devenant ainsi un bastion avancé du « Monde libre » à l'intérieur du Bloc communiste. Après la chute du mur, Berlin redevint, en 1990, la capitale de l'Allemagne alors réunifiée, et les principales institutions fédérales y emménagèrent en 1999. Berlin est une ville mondiale culturelle et artistique de premier plan. La ville abrite 166 musées, 142 bibliothèques et 60 théâtres. En 2014, Berlin a accueilli 11,87 millions de visiteurs (+4,8 % plus qu'en 2013), dont 4,52 millions visiteurs étrangers (+5,2 %)."@fr .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlin (/bərˈlɪn/, [bɛɐ̯ˈliːn]) is the capital of Germany and one of the 16 states of Germany. With a population of 3.5 million people, it is the second most populous city proper and the seventh most populous urban area in the European Union. Located in northeastern Germany on the banks of Rivers Spree and Havel, it is the centre of the Berlin-Brandenburg Metropolitan Region, which has about six million residents from over 180 nations. Due to its location in the European Plain, Berlin is influenced by a temperate seasonal climate. Around one-third of the city's area is composed of forests, parks, gardens, rivers and lakes. First documented in the 13th century and situated at the crossing of two important historic trade routes, Berlin became the capital of the Margraviate of Brandenburg (1417–1701), the Kingdom of Prussia (1701–1918), the German Empire (1871–1918), the Weimar Republic (1919–1933) and the Third Reich (1933–1945). Berlin in the 1920s was the third largest municipality in the world. After World War II, the city was divided; East Berlin became the capital of East Germany while West Berlin became a de facto West German exclave, surrounded by the Berlin Wall (1961–1989) and East Germany territory. Following German reunification in 1990, Berlin was once again designated as the capital of united Germany. Berlin is a world city of culture, politics, media and science. Its economy is based on high-tech firms and the service sector, encompassing a diverse range of creative industries, research facilities, media corporations and convention venues. Berlin serves as a continental hub for air and rail traffic and has a highly complex public transportation network. The metropolis is a popular tourist destination. Significant industries also include IT, pharmaceuticals, biomedical engineering, clean tech, biotechnology, construction and electronics. Modern Berlin is home to world renowned universities, orchestras, museums, entertainment venues and is host to many sporting events. Its urban setting has made it a sought-after location for international film productions. The city is well known for its festivals, diverse architecture, nightlife, contemporary arts and a high quality of living. Over the last decade Berlin has seen the emergence of a cosmopolitan entrepreneurial scene."@en .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlim (em alemão Berlin) é a capital e um dos dezesseis estados da Alemanha. Com uma população de 3,5 milhões dentro de limites da cidade, é a maior cidade do país, além de ser a segunda mais populosa e a sétima área urbana mais povoada da União Europeia. Situada no nordeste da Alemanha, é o centro da área metropolitana de Berlim-Brandemburgo, que inclui 5 milhões de pessoas de mais de 190 nações. Localizada na grande planície europeia, Berlim é influenciada por um clima temperado sazonal. Cerca de um terço da área da cidade é composta por florestas, parques, jardins, rios e lagos. Documentada pela primeira vez no século XIII, Berlim foi sucessivamente a capital do Reino da Prússia (1701-1918), do Império Alemão (1871-1918), da República de Weimar (1919-1933) e do Terceiro Reich (1933-1945). Após a Segunda Guerra Mundial, a cidade foi dividida; Berlim Oriental se tornou a capital da Alemanha Oriental, enquanto Berlim Ocidental se tornou um exclave da Alemanha Ocidental, cercada pelo muro de Berlim, entre os anos de 1961-1989, enquanto a cidade de Bona tornou-se a capital da Alemanha Ocidental. Após a reunificação alemã em 1990, a cidade recuperou o seu estatuto, como a capital da República Federal da Alemanha, sediando 147 embaixadas estrangeiras. Berlim é uma cidade global e um dos mais influentes centros mundiais de cultura, política, mídia e ciência. Sua economia é baseada principalmente no setor de serviços, abrangendo uma variada gama de indústrias criativas, as corporações de mídia e locais de convenções. Berlim também serve como um hub continental para o transporte aéreo e ferroviário, e é um destino turístico popular. As indústrias significativas incluem TI, farmacêuticas, engenharia biomédica, biotecnologia, eletrônica, engenharia de tráfego e energia renovável. A cidade serve como um importante centro do transporte continental e é a sede de algumas das mais importantes universidades, eventos esportivos, orquestras e museus. O rápido desenvolvimento da metrópole atraiu uma reputação internacional aos seus festivais, arquitetura contemporânea e vida noturna, sendo um grande centro turístico e moradia para pessoas de 180 nações diferentes."@pt .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlin ([bɛɐ̯ˈliːn]) ist die Bundeshauptstadt der Bundesrepublik Deutschland und zugleich eines ihrer Länder. Die Stadt Berlin ist mit rund 3,5 Millionen Einwohnern die bevölkerungsreichste und mit 892 Quadratkilometern die flächengrößte Gemeinde Deutschlands sowie nach Einwohnern die zweitgrößte der Europäischen Union. Sie bildet das Zentrum der Metropolregion Berlin/Brandenburg (6 Millionen Einw.) und der Agglomeration Berlin (4,4 Millionen Einw.). Der Stadtstaat unterteilt sich in zwölf Bezirke. Neben den Flüssen Spree und Havel befinden sich im Stadtgebiet kleinere Fließgewässer sowie zahlreiche Seen und Wälder. Urkundlich erstmals im 13. Jahrhundert erwähnt, war Berlin im Verlauf der Geschichte und in verschiedenen Staatsformen Residenz- und Hauptstadt Brandenburgs, Preußens und des Deutschen Reichs. Ab 1949 war der Ostteil der Stadt faktisch Hauptstadt der Deutschen Demokratischen Republik. Mit der deutschen Wiedervereinigung im Jahr 1990 war Berlin wieder gesamtdeutsche Hauptstadt und wurde in der Folge Sitz der Bundesregierung, des Bundespräsidenten, des Deutschen Bundestags, des Bundesrats sowie zahlreicher Bundesministerien und Botschaften. Berlin ist ein europäischer Knotenpunkt für Schienen- und Luftverkehr. Zu den wichtigen Wirtschaftszweigen der Stadt zählen u. a. der Tourismus, die Kreativ- und Kulturwirtschaft, die Biotechnologie, die Medizintechnik, die pharmazeutische Industrie, die Informations- und Kommunikationstechnologien, die Bau- und Immobilienwirtschaft, der Handel, die Optoelektronik, die Energietechnik sowie die Messe- und Kongresswirtschaft. Berlin zählt zu den aufstrebenden, internationalen Zentren für innovative Unternehmensgründer und verzeichnet jährlich hohe Zuwachsraten bei der Zahl der Erwerbstätigen. Berlin gilt als Weltstadt der Kultur, Politik, Medien und Wissenschaften. Die Universitäten, Forschungseinrichtungen, Sportereignisse und Museen Berlins genießen internationalen Ruf. Die Metropole trägt den UNESCO-Titel Stadt des Designs und ist eines der meistbesuchten Zentren des Kontinents. Berlins Architektur, Festivals, Nachtleben und vielfältige Lebensbedingungen sind weltweit bekannt."@de .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlín (Berlin en alemán (Acerca de este sonido [bɛɐ̯ˈliːn] )) es la capital de Alemania y uno de los dieciséis estados federados alemanes. Se localiza al noreste de Alemania, a escasos 70 km de la frontera con Polonia. Por la ciudad fluyen los ríos Spree, Havel, Panke, Dahme y Wuhle. Con una población de 3,4 millones de habitantes, Berlín es la ciudad más poblada del país, así como la segunda ciudad en tamaño y la quinta aglomeración urbana entre los países de la Unión Europea. Fundada en 1237 como Cölln, Berlín fue sucesivamente capital del Reino de Prusia (1701-1918), de la República de Weimar (1919–1933) y del Tercer Reich (1933–1945). Después de la Segunda Guerra Mundial, la ciudad fue dividida; la parte este de la ciudad se convirtió en la capital de la República Democrática Alemana, mientras que la región oeste de la ciudad se convirtió en un enclave de la República Federal de Alemania en el interior de la Alemania Oriental. Berlín es una ciudad mundial y un centro cultural y artístico de primer nivel. Es una de las ciudades más influyentes en el ámbito político de la Unión Europea y en 2006 fue elegida Ciudad Creativa por la Unesco. En 2009 la ciudad recibió el Premio Príncipe de Asturias de la Concordia."@es .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlijn (Duits: Berlin) is de hoofdstad van Duitsland en als stadstaat een deelstaat van dat land. Met 3.437.916 inwoners is Berlijn tevens de grootste stad van het land en de op één na grootste stad in de Europese Unie. De stad ligt in het noordoosten van Duitsland, aan de rivier de Spree en wordt omsloten door de deelstaat Brandenburg, waarvan ze sinds 1920 geen deel meer uitmaakt. In zijn geschiedenis, die teruggaat tot de dertiende eeuw, was Berlijn de hoofdstad van Pruisen (1701–1918), het Duitse Keizerrijk (1871–1918), de Weimarrepubliek (1919–1933) en nazi-Duitsland (1933–1945). Na de Tweede Wereldoorlog was Berlijn gedurende meer dan veertig jaar een verdeelde stad, waarbij het oostelijke deel als hoofdstad fungeerde van de Duitse Democratische Republiek en West-Berlijn een de facto exclave van West-Duitsland was. Na de Duitse hereniging in 1990 werd Berlijn de hoofdstad van de Bondsrepubliek Duitsland en de zetel van het parlement, de deelstaatvertegenwoordiging en het staatshoofd. Berlijn is een metropool en geldt in Europa als een van de grootste culturele, politieke en wetenschappelijke centra. De stad is ook bekend vanwege het hoog-ontwikkelde culturele leven (festivals, nachtleven, musea, kunsttentoonstellingen enz.) en de liberale levensstijl, moderne Zeitgeist en de lage kosten. Bovendien is Berlijn een van de groenste steden van Europa: 22% van Berlijn bestaat uit natuur en parken en 6% uit meren, rivieren en kanalen."@nl .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlin – stolica, siedziba rządu Republiki Federalnej Niemiec. Największe miasto Niemiec, na prawach kraju związkowego. Zajmuje powierzchnię ok. 892 km², zamieszkuje je 3,4 mln osób. Jest trzecim największym (po Londynie i Paryżu) miastem w Unii Europejskiej. Berlin jest podzielony na dwanaście okręgów administracyjnych (Bezirk). Przez przestrzeń miejską przepływają m.in. rzeki Sprewa i Hawela, a ponadto znajduje się wiele jezior i zatok, w tym największe Müggelsee. Pierwsza wzmianka o mieście pochodzi z 1237. Berlin pełnił rolę historycznej stolicy Brandenburgii, Prus, Cesarstwa Niemieckiego, Republiki Weimarskiej i III Rzeszy. Po 1945 wschodnia część miasta była stolicą Niemieckiej Republiki Demokratycznej, natomiast pozostała tworzyła Berlin Zachodni – otoczona murem (od 1961) enklawa na terenie NRD. Po zjednoczeniu Niemiec w 1990 Berlin został ponownie stolicą Niemiec, siedzibą prezydenta (od 1994), niemieckiego Bundestagu (od 1999) i Bundesratu (od 2000). Berlin jest jedną z ważniejszych w Europie metropolii globalnych, ponadto ważnym węzłem komunikacyjnym Niemiec i Europy, zarówno kolejowym, lotniczym i drogowym. Ważny ośrodek naukowy, kulturalny i artystyczny (m.in. Kulturforum i Museumsinsel)."@pl .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlino (in tedesco: Berlin, /bɛɐ̪ ˈliːn/, ) è la maggiore città e nel contempo un Bundesland della Germania, quindi una città-stato. Capitale federale della Repubblica Federale di Germania e sede del suo governo, è uno dei più importanti centri politici, culturali, scientifici, fieristici e mediatici d'Europa e, dopo Londra, il secondo comune più popoloso dell'Unione europea, con 3 531 201 abitanti. L'area metropolitana ha una superficie complessiva di 2 851 km² ed una popolazione di 4 462 166 abitanti, mentre la regione metropolitana di Berlino e Brandeburgo ha una superficie di 30 370 km² ed una popolazione di 6 024 000 abitanti."@it .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "ベルリン（独: Berlin [bɛɐ̯ˈliːn]、伯林）は、ドイツの都市で同国の首都である。16ある連邦州のうちの一つで、市域人口は350万人とドイツでは最大の都市で欧州連合の市域人口ではロンドンに次いで2番目に多く、都市的地域の人口は7番目に多い。"@ja .
