        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlin ([b\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFDli\uFFFD\uFFFDn]) ist die Bundeshauptstadt der Bundesrepublik Deutschland und zugleich eines ihrer L\uFFFD\uFFFDnder. Die Stadt Berlin ist mit rund 3,5 Millionen Einwohnern die bev\uFFFD\uFFFDlkerungsreichste und mit 892 Quadratkilometern die fl\uFFFD\uFFFDchengr\uFFFD\uFFFD\uFFFD\uFFFDte Gemeinde Deutschlands sowie nach Einwohnern die zweitgr\uFFFD\uFFFD\uFFFD\uFFFDte der Europ\uFFFD\uFFFDischen Union. Sie bildet das Zentrum der Metropolregion Berlin/Brandenburg (6 Millionen Einw.) und der Agglomeration Berlin (4,4 Millionen Einw.). Der Stadtstaat unterteilt sich in zw\uFFFD\uFFFDlf Bezirke. Neben den Fl\uFFFD\uFFFDssen Spree und Havel befinden sich im Stadtgebiet kleinere Flie\uFFFD\uFFFDgew\uFFFD\uFFFDsser sowie zahlreiche Seen und W\uFFFD\uFFFDlder. Urkundlich erstmals im 13. Jahrhundert erw\uFFFD\uFFFDhnt, war Berlin im Verlauf der Geschichte und in verschiedenen Staatsformen Residenz- und Hauptstadt Brandenburgs, Preu\uFFFD\uFFFDens und des Deutschen Reichs. Ab 1949 war der Ostteil der Stadt faktisch Hauptstadt der Deutschen Demokratischen Republik. Mit der deutschen Wiedervereinigung im Jahr 1990 war Berlin wieder gesamtdeutsche Hauptstadt und wurde in der Folge Sitz der Bundesregierung, des Bundespr\uFFFD\uFFFDsidenten, des Deutschen Bundestags, des Bundesrats sowie zahlreicher Bundesministerien und Botschaften. Berlin ist ein europ\uFFFD\uFFFDischer Knotenpunkt f\uFFFD\uFFFDr Schienen- und Luftverkehr. Zu den wichtigen Wirtschaftszweigen der Stadt z\uFFFD\uFFFDhlen u. a. der Tourismus, die Kreativ- und Kulturwirtschaft, die Biotechnologie, die Medizintechnik, die pharmazeutische Industrie, die Informations- und Kommunikationstechnologien, die Bau- und Immobilienwirtschaft, der Handel, die Optoelektronik, die Energietechnik sowie die Messe- und Kongresswirtschaft. Berlin z\uFFFD\uFFFDhlt zu den aufstrebenden, internationalen Zentren f\uFFFD\uFFFDr innovative Unternehmensgr\uFFFD\uFFFDnder und verzeichnet j\uFFFD\uFFFDhrlich hohe Zuwachsraten bei der Zahl der Erwerbst\uFFFD\uFFFDtigen. Berlin gilt als Weltstadt der Kultur, Politik, Medien und Wissenschaften. Die Universit\uFFFD\uFFFDten, Forschungseinrichtungen, Sportereignisse und Museen Berlins genie\uFFFD\uFFFDen internationalen Ruf. Die Metropole tr\uFFFD\uFFFDgt den UNESCO-Titel Stadt des Designs und ist eines der meistbesuchten Zentren des Kontinents. Berlins Architektur, Festivals, Nachtleben und vielf\uFFFD\uFFFDltige Lebensbedingungen sind weltweit bekannt."@de .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlin \uFFFD\uFFFD\uFFFD stolica, siedziba rz\uFFFD\uFFFDdu Republiki Federalnej Niemiec. Najwi\uFFFD\uFFFDksze miasto Niemiec, na prawach kraju zwi\uFFFD\uFFFDzkowego. Zajmuje powierzchni\uFFFD\uFFFD ok. 892 km\uFFFD\uFFFD, zamieszkuje je 3,4 mln os\uFFFD\uFFFDb. Jest trzecim najwi\uFFFD\uFFFDkszym (po Londynie i Pary\uFFFD\uFFFDu) miastem w Unii Europejskiej. Berlin jest podzielony na dwana\uFFFD\uFFFDcie okr\uFFFD\uFFFDg\uFFFD\uFFFDw administracyjnych (Bezirk). Przez przestrze\uFFFD\uFFFD miejsk\uFFFD\uFFFD przep\uFFFD\uFFFDywaj\uFFFD\uFFFD m.in. rzeki Sprewa i Hawela, a ponadto znajduje si\uFFFD\uFFFD wiele jezior i zatok, w tym najwi\uFFFD\uFFFDksze M\uFFFD\uFFFDggelsee. Pierwsza wzmianka o mie\uFFFD\uFFFDcie pochodzi z 1237. Berlin pe\uFFFD\uFFFDni\uFFFD\uFFFD rol\uFFFD\uFFFD historycznej stolicy Brandenburgii, Prus, Cesarstwa Niemieckiego, Republiki Weimarskiej i III Rzeszy. Po 1945 wschodnia cz\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD miasta by\uFFFD\uFFFDa stolic\uFFFD\uFFFD Niemieckiej Republiki Demokratycznej, natomiast pozosta\uFFFD\uFFFDa tworzy\uFFFD\uFFFDa Berlin Zachodni \uFFFD\uFFFD\uFFFD otoczona murem (od 1961) enklawa na terenie NRD. Po zjednoczeniu Niemiec w 1990 Berlin zosta\uFFFD\uFFFD ponownie stolic\uFFFD\uFFFD Niemiec, siedzib\uFFFD\uFFFD prezydenta (od 1994), niemieckiego Bundestagu (od 1999) i Bundesratu (od 2000). Berlin jest jedn\uFFFD\uFFFD z wa\uFFFD\uFFFDniejszych w Europie metropolii globalnych, ponadto wa\uFFFD\uFFFDnym w\uFFFD\uFFFDz\uFFFD\uFFFDem komunikacyjnym Niemiec i Europy, zar\uFFFD\uFFFDwno kolejowym, lotniczym i drogowym. Wa\uFFFD\uFFFDny o\uFFFD\uFFFDrodek naukowy, kulturalny i artystyczny (m.in. Kulturforum i Museumsinsel)."@pl .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD: Berlin [b\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFDli\uFFFD\uFFFDn]\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD16\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD350\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD2\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD7\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD"@ja .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlijn (Duits: Berlin) is de hoofdstad van Duitsland en als stadstaat een deelstaat van dat land. Met 3.437.916 inwoners is Berlijn tevens de grootste stad van het land en de op \uFFFD\uFFFD\uFFFD\uFFFDn na grootste stad in de Europese Unie. De stad ligt in het noordoosten van Duitsland, aan de rivier de Spree en wordt omsloten door de deelstaat Brandenburg, waarvan ze sinds 1920 geen deel meer uitmaakt. In zijn geschiedenis, die teruggaat tot de dertiende eeuw, was Berlijn de hoofdstad van Pruisen (1701\uFFFD\uFFFD\uFFFD1918), het Duitse Keizerrijk (1871\uFFFD\uFFFD\uFFFD1918), de Weimarrepubliek (1919\uFFFD\uFFFD\uFFFD1933) en nazi-Duitsland (1933\uFFFD\uFFFD\uFFFD1945). Na de Tweede Wereldoorlog was Berlijn gedurende meer dan veertig jaar een verdeelde stad, waarbij het oostelijke deel als hoofdstad fungeerde van de Duitse Democratische Republiek en West-Berlijn een de facto exclave van West-Duitsland was. Na de Duitse hereniging in 1990 werd Berlijn de hoofdstad van de Bondsrepubliek Duitsland en de zetel van het parlement, de deelstaatvertegenwoordiging en het staatshoofd. Berlijn is een metropool en geldt in Europa als een van de grootste culturele, politieke en wetenschappelijke centra. De stad is ook bekend vanwege het hoog-ontwikkelde culturele leven (festivals, nachtleven, musea, kunsttentoonstellingen enz.) en de liberale levensstijl, moderne Zeitgeist en de lage kosten. Bovendien is Berlijn een van de groenste steden van Europa: 22% van Berlijn bestaat uit natuur en parken en 6% uit meren, rivieren en kanalen."@nl .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlin (/b\uFFFD\uFFFDr\uFFFD\uFFFDl\uFFFD\uFFFDn/, [b\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFDli\uFFFD\uFFFDn]) is the capital of Germany and one of the 16 states of Germany. With a population of 3.5 million people, it is the second most populous city proper and the seventh most populous urban area in the European Union. Located in northeastern Germany on the banks of Rivers Spree and Havel, it is the centre of the Berlin-Brandenburg Metropolitan Region, which has about six million residents from over 180 nations. Due to its location in the European Plain, Berlin is influenced by a temperate seasonal climate. Around one-third of the city's area is composed of forests, parks, gardens, rivers and lakes. First documented in the 13th century and situated at the crossing of two important historic trade routes, Berlin became the capital of the Margraviate of Brandenburg (1417\uFFFD\uFFFD\uFFFD1701), the Kingdom of Prussia (1701\uFFFD\uFFFD\uFFFD1918), the German Empire (1871\uFFFD\uFFFD\uFFFD1918), the Weimar Republic (1919\uFFFD\uFFFD\uFFFD1933) and the Third Reich (1933\uFFFD\uFFFD\uFFFD1945). Berlin in the 1920s was the third largest municipality in the world. After World War II, the city was divided; East Berlin became the capital of East Germany while West Berlin became a de facto West German exclave, surrounded by the Berlin Wall (1961\uFFFD\uFFFD\uFFFD1989) and East Germany territory. Following German reunification in 1990, Berlin was once again designated as the capital of united Germany. Berlin is a world city of culture, politics, media and science. Its economy is based on high-tech firms and the service sector, encompassing a diverse range of creative industries, research facilities, media corporations and convention venues. Berlin serves as a continental hub for air and rail traffic and has a highly complex public transportation network. The metropolis is a popular tourist destination. Significant industries also include IT, pharmaceuticals, biomedical engineering, clean tech, biotechnology, construction and electronics. Modern Berlin is home to world renowned universities, orchestras, museums, entertainment venues and is host to many sporting events. Its urban setting has made it a sought-after location for international film productions. The city is well known for its festivals, diverse architecture, nightlife, contemporary arts and a high quality of living. Over the last decade Berlin has seen the emergence of a cosmopolitan entrepreneurial scene."@en .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlin (prononc\uFFFD\uFFFD [b\uFFFD\uFFFD\uFFFD\uFFFD.l\uFFFD\uFFFD\uFFFD\uFFFD] ; en allemand Berlin [b\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD.\uFFFD\uFFFDli\uFFFD\uFFFDn] ) est la capitale et la plus grande ville d'Allemagne. Situ\uFFFD\uFFFDe dans le nord-est du pays, elle forme un land (\uFFFD\uFFFDtat f\uFFFD\uFFFDd\uFFFD\uFFFDr\uFFFD\uFFFD) \uFFFD\uFFFD part enti\uFFFD\uFFFDre et compte environ 3,5 millions d'habitants. Ses habitants s'appellent les Berlinois. Berlin est la deuxi\uFFFD\uFFFDme ville et la septi\uFFFD\uFFFDme agglom\uFFFD\uFFFDration la plus peupl\uFFFD\uFFFDe de l'Union europ\uFFFD\uFFFDenne. L'agglom\uFFFD\uFFFDration de Berlin s'\uFFFD\uFFFDtend sur 3 734 km2 et compte 4,4 millions d'habitants, et la r\uFFFD\uFFFDgion m\uFFFD\uFFFDtropolitaine de Berlin-Brandebourg qui cumule les L\uFFFD\uFFFDnder de Berlin et de Brandebourg regroupe au total pr\uFFFD\uFFFDs de 6 millions d'habitants. Fond\uFFFD\uFFFDe au XIIIe si\uFFFD\uFFFDcle, Berlin a \uFFFD\uFFFDt\uFFFD\uFFFD successivement capitale du royaume de Prusse (1701-1871), de l'Empire allemand (1871-1918), de la R\uFFFD\uFFFDpublique de Weimar (1919-1933) et du Troisi\uFFFD\uFFFDme Reich (1933-1945). Apr\uFFFD\uFFFDs 1945 et jusqu'\uFFFD\uFFFD la chute du Mur de Berlin en 1989, la ville est partag\uFFFD\uFFFDe en quatre secteurs d'occupation. Pendant la Guerre froide, le secteur sovi\uFFFD\uFFFDtique de la ville, nomm\uFFFD\uFFFD Berlin-Est, est devenu la capitale de la R\uFFFD\uFFFDpublique d\uFFFD\uFFFDmocratique allemande, tandis que Berlin-Ouest \uFFFD\uFFFDtait politiquement rattach\uFFFD\uFFFDe \uFFFD\uFFFD la R\uFFFD\uFFFDpublique f\uFFFD\uFFFDd\uFFFD\uFFFDrale d'Allemagne, devenant ainsi un bastion avanc\uFFFD\uFFFD du \uFFFD\uFFFD Monde libre \uFFFD\uFFFD \uFFFD\uFFFD l'int\uFFFD\uFFFDrieur du Bloc communiste. Apr\uFFFD\uFFFDs la chute du mur, Berlin redevint, en 1990, la capitale de l'Allemagne alors r\uFFFD\uFFFDunifi\uFFFD\uFFFDe, et les principales institutions f\uFFFD\uFFFDd\uFFFD\uFFFDrales y emm\uFFFD\uFFFDnag\uFFFD\uFFFDrent en 1999. Berlin est une ville mondiale culturelle et artistique de premier plan. La ville abrite 166 mus\uFFFD\uFFFDes, 142 biblioth\uFFFD\uFFFDques et 60 th\uFFFD\uFFFD\uFFFD\uFFFDtres. En 2014, Berlin a accueilli 11,87 millions de visiteurs (+4,8 % plus qu'en 2013), dont 4,52 millions visiteurs \uFFFD\uFFFDtrangers (+5,2 %)."@fr .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD (\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD: Berlin) \uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD. \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \"\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\" \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFF