        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berl\uFFFD\uFFFDn (Berlin en alem\uFFFD\uFFFDn (Acerca de este sonido [b\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFDli\uFFFD\uFFFDn] )) es la capital de Alemania y uno de los diecis\uFFFD\uFFFDis estados federados alemanes. Se localiza al noreste de Alemania, a escasos 70 km de la frontera con Polonia. Por la ciudad fluyen los r\uFFFD\uFFFDos Spree, Havel, Panke, Dahme y Wuhle. Con una poblaci\uFFFD\uFFFDn de 3,4 millones de habitantes, Berl\uFFFD\uFFFDn es la ciudad m\uFFFD\uFFFDs poblada del pa\uFFFD\uFFFDs, as\uFFFD\uFFFD como la segunda ciudad en tama\uFFFD\uFFFDo y la quinta aglomeraci\uFFFD\uFFFDn urbana entre los pa\uFFFD\uFFFDses de la Uni\uFFFD\uFFFDn Europea. Fundada en 1237 como C\uFFFD\uFFFDlln, Berl\uFFFD\uFFFDn fue sucesivamente capital del Reino de Prusia (1701-1918), de la Rep\uFFFD\uFFFDblica de Weimar (1919\uFFFD\uFFFD\uFFFD1933) y del Tercer Reich (1933\uFFFD\uFFFD\uFFFD1945). Despu\uFFFD\uFFFDs de la Segunda Guerra Mundial, la ciudad fue dividida; la parte este de la ciudad se convirti\uFFFD\uFFFD en la capital de la Rep\uFFFD\uFFFDblica Democr\uFFFD\uFFFDtica Alemana, mientras que la regi\uFFFD\uFFFDn oeste de la ciudad se convirti\uFFFD\uFFFD en un enclave de la Rep\uFFFD\uFFFDblica Federal de Alemania en el interior de la Alemania Oriental. Berl\uFFFD\uFFFDn es una ciudad mundial y un centro cultural y art\uFFFD\uFFFDstico de primer nivel. Es una de las ciudades m\uFFFD\uFFFDs influyentes en el \uFFFD\uFFFDmbito pol\uFFFD\uFFFDtico de la Uni\uFFFD\uFFFDn Europea y en 2006 fue elegida Ciudad Creativa por la Unesco. En 2009 la ciudad recibi\uFFFD\uFFFD el Premio Pr\uFFFD\uFFFDncipe de Asturias de la Concordia."@es .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlim (em alem\uFFFD\uFFFDo Berlin) \uFFFD\uFFFD a capital e um dos dezesseis estados da Alemanha. Com uma popula\uFFFD\uFFFD\uFFFD\uFFFDo de 3,5 milh\uFFFD\uFFFDes dentro de limites da cidade, \uFFFD\uFFFD a maior cidade do pa\uFFFD\uFFFDs, al\uFFFD\uFFFDm de ser a segunda mais populosa e a s\uFFFD\uFFFDtima \uFFFD\uFFFDrea urbana mais povoada da Uni\uFFFD\uFFFDo Europeia. Situada no nordeste da Alemanha, \uFFFD\uFFFD o centro da \uFFFD\uFFFDrea metropolitana de Berlim-Brandemburgo, que inclui 5 milh\uFFFD\uFFFDes de pessoas de mais de 190 na\uFFFD\uFFFD\uFFFD\uFFFDes. Localizada na grande plan\uFFFD\uFFFDcie europeia, Berlim \uFFFD\uFFFD influenciada por um clima temperado sazonal. Cerca de um ter\uFFFD\uFFFDo da \uFFFD\uFFFDrea da cidade \uFFFD\uFFFD composta por florestas, parques, jardins, rios e lagos. Documentada pela primeira vez no s\uFFFD\uFFFDculo XIII, Berlim foi sucessivamente a capital do Reino da Pr\uFFFD\uFFFDssia (1701-1918), do Imp\uFFFD\uFFFDrio Alem\uFFFD\uFFFDo (1871-1918), da Rep\uFFFD\uFFFDblica de Weimar (1919-1933) e do Terceiro Reich (1933-1945). Ap\uFFFD\uFFFDs a Segunda Guerra Mundial, a cidade foi dividida; Berlim Oriental se tornou a capital da Alemanha Oriental, enquanto Berlim Ocidental se tornou um exclave da Alemanha Ocidental, cercada pelo muro de Berlim, entre os anos de 1961-1989, enquanto a cidade de Bona tornou-se a capital da Alemanha Ocidental. Ap\uFFFD\uFFFDs a reunifica\uFFFD\uFFFD\uFFFD\uFFFDo alem\uFFFD\uFFFD em 1990, a cidade recuperou o seu estatuto, como a capital da Rep\uFFFD\uFFFDblica Federal da Alemanha, sediando 147 embaixadas estrangeiras. Berlim \uFFFD\uFFFD uma cidade global e um dos mais influentes centros mundiais de cultura, pol\uFFFD\uFFFDtica, m\uFFFD\uFFFDdia e ci\uFFFD\uFFFDncia. Sua economia \uFFFD\uFFFD baseada principalmente no setor de servi\uFFFD\uFFFDos, abrangendo uma variada gama de ind\uFFFD\uFFFDstrias criativas, as corpora\uFFFD\uFFFD\uFFFD\uFFFDes de m\uFFFD\uFFFDdia e locais de conven\uFFFD\uFFFD\uFFFD\uFFFDes. Berlim tamb\uFFFD\uFFFDm serve como um hub continental para o transporte a\uFFFD\uFFFDreo e ferrovi\uFFFD\uFFFDrio, e \uFFFD\uFFFD um destino tur\uFFFD\uFFFDstico popular. As ind\uFFFD\uFFFDstrias significativas incluem TI, farmac\uFFFD\uFFFDuticas, engenharia biom\uFFFD\uFFFDdica, biotecnologia, eletr\uFFFD\uFFFDnica, engenharia de tr\uFFFD\uFFFDfego e energia renov\uFFFD\uFFFDvel. A cidade serve como um importante centro do transporte continental e \uFFFD\uFFFD a sede de algumas das mais importantes universidades, eventos esportivos, orquestras e museus. O r\uFFFD\uFFFDpido desenvolvimento da metr\uFFFD\uFFFDpole atraiu uma reputa\uFFFD\uFFFD\uFFFD\uFFFDo internacional aos seus festivais, arquitetura contempor\uFFFD\uFFFDnea e vida noturna, sendo um grande centro tur\uFFFD\uFFFDstico e moradia para pessoas de 180 na\uFFFD\uFFFD\uFFFD\uFFFDes diferentes."@pt .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlino (in tedesco: Berlin, /b\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFDli\uFFFD\uFFFDn/, ) \uFFFD\uFFFD la maggiore citt\uFFFD\uFFFD e nel contempo un Bundesland della Germania, quindi una citt\uFFFD\uFFFD-stato. Capitale federale della Repubblica Federale di Germania e sede del suo governo, \uFFFD\uFFFD uno dei pi\uFFFD\uFFFD importanti centri politici, culturali, scientifici, fieristici e mediatici d'Europa e, dopo Londra, il secondo comune pi\uFFFD\uFFFD popoloso dell'Unione europea, con 3 531 201 abitanti. L'area metropolitana ha una superficie complessiva di 2 851 km\uFFFD\uFFFD ed una popolazione di 4 462 166 abitanti, mentre la regione metropolitana di Berlino e Brandeburgo ha una superficie di 30 370 km\uFFFD\uFFFD ed una popolazione di 6 024 000 abitanti."@it .
