        <http://dbpedia.org/resource/Berlin> <http://www.w3.org/2000/01/rdf-schema#comment> "Berlin \uFFFD\uFFFD\uFFFD stolica, siedziba rz\uFFFD\uFFFDdu Republiki Federalnej Niemiec. Najwi\uFFFD\uFFFDksze miasto Niemiec, na prawach kraju zwi\uFFFD\uFFFDzkowego. Zajmuje powierzchni\uFFFD\uFFFD ok. 892 km\uFFFD\uFFFD, zamieszkuje je 3,4 mln os\uFFFD\uFFFDb. Jest trzecim najwi\uFFFD\uFFFDkszym (po Londynie i Pary\uFFFD\uFFFDu) miastem w Unii Europejskiej.Berlin jest podzielony na dwana\uFFFD\uFFFDcie okr\uFFFD\uFFFDg\uFFFD\uFFFDw administracyjnych (Bezirk). Przez przestrze\uFFFD\uFFFD miejsk\uFFFD\uFFFD przep\uFFFD\uFFFDywaj\uFFFD\uFFFD m.in. rzeki Sprewa i Hawela, a ponadto znajduje si\uFFFD\uFFFD wiele jezior i zatok, w tym najwi\uFFFD\uFFFDksze M\uFFFD\uFFFDggelsee."@pl .
        <http://dbpedia.org/resource/Berlin> <http://www.w3.org/2000/01/rdf-schema#comment> "Berl\uFFFD\uFFFDn (Berlin en alem\uFFFD\uFFFDn (Acerca de este sonido [b\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFDli\uFFFD\uFFFDn] )) es la capital de Alemania y uno de los diecis\uFFFD\uFFFDis estados federados alemanes. Se localiza al noreste de Alemania, a escasos 70 km de la frontera con Polonia. Por la ciudad fluyen los r\uFFFD\uFFFDos Spree, Havel, Panke, Dahme y Wuhle. Con una poblaci\uFFFD\uFFFDn de 3,4 millones de habitantes, Berl\uFFFD\uFFFDn es la ciudad m\uFFFD\uFFFDs poblada del pa\uFFFD\uFFFDs, as\uFFFD\uFFFD como la segunda ciudad en tama\uFFFD\uFFFDo y la quinta aglomeraci\uFFFD\uFFFDn urbana entre los pa\uFFFD\uFFFDses de la Uni\uFFFD\uFFFDn Europea."@es .
        <http://dbpedia.org/resource/Berlin> <http://www.w3.org/2000/01/rdf-schema#comment> "Berlin (/b\uFFFD\uFFFDr\uFFFD\uFFFDl\uFFFD\uFFFDn/, [b\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFDli\uFFFD\uFFFDn]) is the capital of Germany and one of the 16 states of Germany. With a population of 3.5 million people, it is the second most populous city proper and the seventh most populous urban area in the European Union. Located in northeastern Germany on the banks of Rivers Spree and Havel, it is the centre of the Berlin-Brandenburg Metropolitan Region, which has about six million residents from over 180 nations. Due to its location in the European Plain, Berlin is influenced by a temperate seasonal climate. Around one-third of the city's area is composed of forests, parks, gardens, rivers and lakes."@en .
        <http://dbpedia.org/resource/Berlin> <http://www.w3.org/2000/01/rdf-schema#comment> "\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD: Berlin [b\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFDli\uFFFD\uFFFDn]\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD16\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD350\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD2\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD7\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD"@ja .
        <http://dbpedia.org/resource/Berlin> <http://www.w3.org/2000/01/rdf-schema#comment> "Berlim (em alem\uFFFD\uFFFDo Berlin) \uFFFD\uFFFD a capital e um dos dezesseis estados da Alemanha. Com uma popula\uFFFD\uFFFD\uFFFD\uFFFDo de 3,5 milh\uFFFD\uFFFDes dentro de limites da cidade, \uFFFD\uFFFD a maior cidade do pa\uFFFD\uFFFDs, al\uFFFD\uFFFDm de ser a segunda mais populosa e a s\uFFFD\uFFFDtima \uFFFD\uFFFDrea urbana mais povoada da Uni\uFFFD\uFFFDo Europeia. Situada no nordeste da Alemanha, \uFFFD\uFFFD o centro da \uFFFD\uFFFDrea metropolitana de Berlim-Brandemburgo, que inclui 5 milh\uFFFD\uFFFDes de pessoas de mais de 190 na\uFFFD\uFFFD\uFFFD\uFFFDes. Localizada na grande plan\uFFFD\uFFFDcie europeia, Berlim \uFFFD\uFFFD influenciada por um clima temperado sazonal. Cerca de um ter\uFFFD\uFFFDo da \uFFFD\uFFFDrea da cidade \uFFFD\uFFFD composta por florestas, parques, jardins, rios e lagos."@pt .
        <http://dbpedia.org/resource/Berlin> <http://www.w3.org/2000/01/rdf-schema#comment> "Berlijn (Duits: Berlin) is de hoofdstad van Duitsland en als stadstaat een deelstaat van dat land. Met 3.437.916 inwoners is Berlijn tevens de grootste stad van het land en de op \uFFFD\uFFFD\uFFFD\uFFFDn na grootste stad in de Europese Unie. De stad ligt in het noordoosten van Duitsland, aan de rivier de Spree en wordt omsloten door de deelstaat Brandenburg, waarvan ze sinds 1920 geen deel meer uitmaakt."@nl .
        <http://dbpedia.org/resource/Berlin> <http://www.w3.org/2000/01/rdf-schema#comment> "Berlin (prononc\uFFFD\uFFFD [b\uFFFD\uFFFD\uFFFD\uFFFD.l\uFFFD\uFFFD\uFFFD\uFFFD] ; en allemand Berlin [b\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD.\uFFFD\uFFFDli\uFFFD\uFFFDn] ) est la capitale et la plus grande ville d'Allemagne.Situ\uFFFD\uFFFDe dans le nord-est du pays, elle forme un land (\uFFFD\uFFFDtat f\uFFFD\uFFFDd\uFFFD\uFFFDr\uFFFD\uFFFD) \uFFFD\uFFFD part enti\uFFFD\uFFFDre et compte environ 3,5 millions d'habitants. Ses habitants s'appellent les Berlinois. Berlin est la deuxi\uFFFD\uFFFDme ville et la septi\uFFFD\uFFFDme agglom\uFFFD\uFFFDration la plus peupl\uFFFD\uFFFDe de l'Union europ\uFFFD\uFFFDenne. L'agglom\uFFFD\uFFFDration de Berlin s'\uFFFD\uFFFDtend sur 3 734 km2 et compte 4,4 millions d'habitants, et la r\uFFFD\uFFFDgion m\uFFFD\uFFFDtropolitaine de Berlin-Brandebourg qui cumule les L\uFFFD\uFFFDnder de Berlin et de Brandebourg regroupe au total pr\uFFFD\uFFFDs de 6 millions d'habitants."@fr .
        <http://dbpedia.org/resource/Berlin> <http://www.w3.org/2000/01/rdf-schema#comment> "Berlin ([b\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFDli\uFFFD\uFFFDn]) ist die Bundeshauptstadt der Bundesrepublik Deutschland und zugleich eines ihrer L\uFFFD\uFFFDnder. Die Stadt Berlin ist mit rund 3,5 Millionen Einwohnern die bev\uFFFD\uFFFDlkerungsreichste und mit 892 Quadratkilometern die fl\uFFFD\uFFFDchengr\uFFFD\uFFFD\uFFFD\uFFFDte Gemeinde Deutschlands sowie nach Einwohnern die zweitgr\uFFFD\uFFFD\uFFFD\uFFFDte der Europ\uFFFD\uFFFDischen Union. Sie bildet das Zentrum der Metropolregion Berlin/Brandenburg (6 Millionen Einw.) und der Agglomeration Berlin (4,4 Millionen Einw.). Der Stadtstaat unterteilt sich in zw\uFFFD\uFFFDlf Bezirke. Neben den Fl\uFFFD\uFFFDssen Spree und Havel befinden sich im Stadtgebiet kleinere Flie\uFFFD\uFFFDgew\uFFFD\uFFFDsser sowie zahlreiche Seen und W\uFFFD\uFFFDlder."@de .
        <http://dbpedia.org/resource/Berlin> <http://www.w3.org/2000/01/rdf-schema#comment> "\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD (\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD: Berlin) \uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD. \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \"\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\" \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFD\uF