        <http://dbpedia.org/resource/Berlin> <http://www.w3.org/2000/01/rdf-schema#comment> "Berlino (in tedesco: Berlin, /b\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD \uFFFD\uFFFDli\uFFFD\uFFFDn/, ) \uFFFD\uFFFD la maggiore citt\uFFFD\uFFFD e nel contempo un Bundesland della Germania, quindi una citt\uFFFD\uFFFD-stato. Capitale federale della Repubblica Federale di Germania e sede del suo governo, \uFFFD\uFFFD uno dei pi\uFFFD\uFFFD importanti centri politici, culturali, scientifici, fieristici e mediatici d'Europa e, dopo Londra, il secondo comune pi\uFFFD\uFFFD popoloso dell'Unione europea, con 3 531 201 abitanti. L'area metropolitana ha una superficie complessiva di 2 851 km\uFFFD\uFFFD ed una popolazione di 4 462 166 abitanti, mentre la regione metropolitana di Berlino e Brandeburgo ha una superficie di 30 370 km\uFFFD\uFFFD ed una popolazione di 6 024 000 abitanti."@it .
